import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for at least one product price to appear using a unique selector
    // Use a different selector: .product-price inside .product-card
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Take screenshot of products grid if present
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      const gridShot = path.join(screenshotsDir, 'step_2_products_grid.png');
      await productsGrid.screenshot({ path: gridShot });
      screenshots.push(gridShot);
    }

    // Extract all product prices using a different selector strategy
    // Use XPath to select all .product-price spans inside .product-card
    const priceHandles = await page.$$('xpath=//div[contains(@class,"product-card")]//div[contains(@class,"product-price")]');

    const prices = [];
    for (const handle of priceHandles) {
      // Get the full text content (may contain original price)
      const text = (await handle.textContent()) || '';
      // Extract the first price (e.g., $1199.99)
      const match = text.match(/\$\d[\d,]*\.?\d{0,2}/);
      if (match) {
        prices.push(match[0]);
      }
    }

    // Take screenshot highlighting the first product card, if present
    const firstCard = await page.$('xpath=(//div[contains(@class,"product-card")])[1]');
    if (firstCard) {
      const cardShot = path.join(screenshotsDir, 'step_3_first_product_card.png');
      await firstCard.screenshot({ path: cardShot });
      screenshots.push(cardShot);
    }

    return {
      success: true,
      action: "Extracted all visible product prices from product cards using XPath and class selectors.",
      extractedData: { prices },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
